import styled from 'styled-components';

const Layout = styled.div`
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: center;
`;

const Footer = () => {
  return (
    <Layout>
      <p>연락처 : 010-1234-5678</p>
      <p>오시는길 : 서울시 강남구</p>
      <p>copyright:&copy;</p>
    </Layout>
  );
};

export default Footer;
